import React from 'react';

const Footer = () => {
  return (
    <div>
      <h1>Contact</h1>
      <span>Github</span>
      <span>LinkedIn</span>
      <span>Resume</span>
      <span>Calendar</span>
      <span>Site by Johnny Kirpalani</span>
    </div>
  );
};

export default Footer;
